import Vue from 'vue'
import App from './App.vue'
import Sign from './Sign.vue'

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')

new Vue({
  render: h => h(Sign),
}).$mount('#sign')
